import React from "react";
import music_logo from "./music1.jpeg";
import './projects_page.css';
const Projects =  () => {
    return(
        <>
        <h1 className="tc white">Projects</h1>
        <div className="project_1">
        <div className="text_project1">
        <h2 className="white">Debut Python Project: Video Downloads & Music Playback </h2>
        <p className="white">My debut Python project introduces me to programming.<br />It employs a library for hassle-free video downloads from links.<br /> The user-centric GUI empowers users to pick folders for downloads or music playback.<br /> MP3s can be directly saved or played in the chosen folder. <br /> Future enhancements paused to prioritize other projects.</p>
        <br />
        <p><a href="https://github.com/RegiLoshi/Python-Music-Player-and-Downloader" target="_blank">Press to go to the Github page...</a></p>
        </div>
        <img src={music_logo} alt="Music App" target='_blank' />
        </div>
        </>
    )
}

export default Projects;
